Badminton footwork determines whether you can hit the ball steadily or not, practice badminton step for a while every day, so that I can play better on the court

Main Functions:
1. Adjust the "practice position", "number of groups" and "frequency" according to your own needs, and then start practicing;
2. Larger graphics will be displayed on iPad for easy viewing;
3. Open "Sound Effect" for a more immersive practice experience;
4. "Dynamic Speed" dynamically adjusts the speed based on your Settings to be closer to the real race;
5. Support multiple languages.

All data in the software is stored locally and no network requests are sent.
